        let product3 = { name: '3', price: 3, description: 'Lorem ipsum dolor sit amet consectetur, adipisicing elit. Enim reiciendis corporis dignissimos, blanditiis a iste sed esse delectus unde dolores, nulla iusto quia, animi doloribus distinctio soluta. Aut, et expedita.', image: 'http://www.clker.com/cliparts/x/B/x/Y/R/L/number-3-md.png', stock: 11 }
